        12:29 local time, presidential candidate and party leader Moise Katumbi lands
        at Kindu Airport in his private jet and is met by supporters. This is when
        the march begins. But it is unclear from available evidence if Kakisingi joins
        the march here or later on down Joseph Kabila Boulevard.\"},\"embed\":{\"$type\":\"app.bsky.embed.images#view\",\"images\":[{\"thumb\":\"https://cdn.bsky.app/img/feed_thumbnail/plain/did:plc:sb54dpdfefflykmf5bcfvr7t/bafkreidh2aqmy62dix5yvfs7f76xcqg2aoh6wgmpg5ssayswzp3ns5aoge@jpeg\",\"fullsize\":\"https://cdn.bsky.app/img/feed_fullsize/plain/did:plc:sb54dpdfefflykmf5bcfvr7t/bafkreidh2aqmy62dix5yvfs7f76xcqg2aoh6wgmpg5ssayswzp3ns5aoge@jpeg\",\"alt\":\"Images
