        how @sarahstoecklin.bsky.social  @jonnyghizmo.bsky.social and Manon McGuigan
        followed the final movements of Kakisingi and the aftermath of his demise.\"},\"replyCount\":1,\"repostCount\":1,\"likeCount\":15,\"quoteCount\":0,\"indexedAt\":\"2024-12-10T13:08:11.273Z\",\"labels\":[]},\"parent\":{\"$type\":\"app.bsky.feed.defs#threadViewPost\",\"post\":{\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpg457e2l\",\"cid\":\"bafyreigoxf74dx2xvqw7lc5gqjywmraqcir4uu34vfp57s233gyrxysazu\",\"author\":{\"did\":\"did:plc:sb54dpdfefflykmf5bcfvr7t\",\"handle\":\"bellingcat.com\",\"displayName\":\"Bellingcat\",\"avatar\":\"https://cdn.bsky.app/img/avatar/plain/did:plc:sb54dpdfefflykmf5bcfvr7t/bafkreick3tvuw6kxfcpjgnxf75dhigmll53w5jgvin4mw3hre344o4tmiu@jpeg\",\"associated\":{\"chat\":{\"allowIncoming\":\"following\"}},\"labels\":[],\"createdAt\":\"2023-04-28T10:47:07.541Z\"},\"record\":{\"$type\":\"app.bsky.feed.post\",\"createdAt\":\"2024-12-10T13:07:43.907Z\",\"langs\":[\"en\"],\"reply\":{\"parent\":{\"cid\":\"bafyreicehfjjsdzm5qdia25yjisffbpgrcqckoq7yrhhyhiz7llepfg5zi\",\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpg457d2l\"},\"root\":{\"cid\":\"bafyreidb3ilxercoug4jye3cntphf3j5ywtufb2w4oibt2ihhgifipvoya\",\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpf26c32l\"}},\"text\":\"In
        October this year two people were convicted to five years in jail in connection
        with the killing but family and supporters say at least 14 other people involved
        in the violence should be arrested and questioned by police.\"},\"replyCount\":1,\"repostCount\":1,\"likeCount\":13,\"quoteCount\":0,\"indexedAt\":\"2024-12-10T13:08:08.477Z\",\"labels\":[]},\"parent\":{\"$type\":\"app.bsky.feed.defs#threadViewPost\",\"post\":{\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpg457d2l\",\"cid\":\"bafyreicehfjjsdzm5qdia25yjisffbpgrcqckoq7yrhhyhiz7llepfg5zi\",\"author\":{\"did\":\"did:plc:sb54dpdfefflykmf5bcfvr7t\",\"handle\":\"bellingcat.com\",\"displayName\":\"Bellingcat\",\"avatar\":\"https://cdn.bsky.app/img/avatar/plain/did:plc:sb54dpdfefflykmf5bcfvr7t/bafkreick3tvuw6kxfcpjgnxf75dhigmll53w5jgvin4mw3hre344o4tmiu@jpeg\",\"associated\":{\"chat\":{\"allowIncoming\":\"following\"}},\"labels\":[],\"createdAt\":\"2023-04-28T10:47:07.541Z\"},\"record\":{\"$type\":\"app.bsky.feed.post\",\"createdAt\":\"2024-12-10T13:07:43.906Z\",\"langs\":[\"en\"],\"reply\":{\"parent\":{\"cid\":\"bafyreidb3ilxercoug4jye3cntphf3j5ywtufb2w4oibt2ihhgifipvoya\",\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpf26c32l\"},\"root\":{\"cid\":\"bafyreidb3ilxercoug4jye3cntphf3j5ywtufb2w4oibt2ihhgifipvoya\",\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpf26c32l\"}},\"text\":\"The
        2023 killing of the lawyer and youth coordinator of political party Ensemble
        Pour la R\xE9publique in the Democratic Republic of the Congo sparked a number
        of misleading reports. Unevidenced claims spread on social media that the
        now President Tshisekedi ordered the police to shoot Dido Kakisingi.\"},\"replyCount\":1,\"repostCount\":1,\"likeCount\":13,\"quoteCount\":0,\"indexedAt\":\"2024-12-10T13:08:05.547Z\",\"labels\":[]},\"parent\":{\"$type\":\"app.bsky.feed.defs#threadViewPost\",\"post\":{\"uri\":\"at://did:plc:sb54dpdfefflykmf5bcfvr7t/app.bsky.feed.post/3lcxcpf26c32l\",\"cid\":\"bafyreidb3ilxercoug4jye3cntphf3j5ywtufb2w4oibt2ihhgifipvoya\",\"author\":{\"did\":\"did:plc:sb54dpdfefflykmf5bcfvr7t\",\"handle\":\"bellingcat.com\",\"displayName\":\"Bellingcat\",\"avatar\":\"https://cdn.bsky.app/img/avatar/plain/did:plc:sb54dpdfefflykmf5bcfvr7t/bafkreick3tvuw6kxfcpjgnxf75dhigmll53w5jgvin4mw3hre344o4tmiu@jpeg\",\"associated\":{\"chat\":{\"allowIncoming\":\"following\"}},\"labels\":[],\"createdAt\":\"2023-04-28T10:47:07.541Z\"},\"record\":{\"$type\":\"app.bsky.feed.post\",\"createdAt\":\"2024-12-10T13:07:43.905Z\",\"embed\":{\"$type\":\"app.bsky.embed.external\",\"external\":{\"description\":\"Here\u2019s
        what open source shows about a march where a protester died in violence during
        the presidential election in the Democratic Republic of the Congo last year.\",\"thumb\":{\"$type\":\"blob\",\"ref\":{\"$link\":\"bafkreifm33ogncqfscg632weifml6ocbrjuz2izqnwanfi7xbvjmnlo7ea\"},\"mimeType\":\"image/jpeg\",\"size\":370825},\"title\":\"Retracing
        the Congolese March Where Dido Kakisingi was Killed - bellingcat\",\"uri\":\"https://www.bellingcat.com/news/2024/12/10/retracing-the-congolese-march-where-dido-kakisingi-was-killed/?utm_source=bluesky\"}},\"facets\":[{\"features\":[{\"$type\":\"app.bsky.richtext.facet#link\",\"uri\":\"https://www.bellingcat.com/news/2024/12/10/retracing-the-congolese-march-where-dido-kakisingi-was-killed/?utm_source=bluesky\"}],\"index\":{\"byteEnd\":277,\"byteStart\":243}}],\"langs\":[\"en\"],\"text\":\"A
        violent brawl during an opposition march leaves a political figure deceased
